INSERT INTO `db_pergunta` (`id`, `pergunta`, `teste_id`, `ativo`) VALUES
(1, '1- ...sinto prazer ao lidar com pessoas e perceber que posso ajudá-las de alguma forma.', 1, 'sim'),
(2, '2- ...conheço o perfil da clientela com a qual trabalho e busco sempre identificar suas necessidades e expectativas.', 1, 'sim'),
(3, '3- ...faço todo o esforço para corresponder às expectativas dos meus clientes, assumindo a responsabilidade por tudo que posso resolver e/ou encaminhando adequadamente, quando o assunto sai de minha alçada.', 1, 'sim'),
(4, '4-... sei ouvir o cliente, mesmo quando este está fazendo uma reclamação, demonstrando atenção pelo que ele está dizendo.', 1, 'sim'),
(5, '5-... sou empático, demonstrando compreender seus sentimentos e o meu interesse em resolver seu problema.', 1, 'sim'),
(6, '6- ... expresso-me claramente e de forma objetiva, usando uma linguagem adequada e profissional.', 1, 'sim'),
(7, '7-...sou assertiva, assumindo firmemente minhas posições, sem desconsiderar os direitos e o ponto de vista do cliente.', 1, 'sim'),
(8, '8-...tenho bom autocontrole, conseguindo conter minha ansiedade, estresse, e sentimentos negativos, tomando decisões e agindo de forma equilibrada e profissional.', 1, 'sim'),
(9, '9- ...estou constantemente buscando conhecer-me melhor, perceber meus pontos de melhoria e avaliando a qualidade do meu trabalho.', 1, 'sim'),
(10, '10-... busco todas as informações necessárias ao bom desempenho de minha atividade, mesmo que elas não cheguem até a mim, visando orientar, adequadamente, os clientes.', 1, 'sim'),
(11, '11-...tenho uma atitude receptiva, através do olhar, do sorriso e dos gestos, demonstrando ao cliente meu interesse em atendê-lo bem.', 1, 'sim'),
(12, '12- ... respeito todos, sem fazer qualquer tipo de discriminação, procurando atender, igualmente, todos, com a maior cortesia.', 1, 'sim'),
(13, '13- ... tenho os conhecimentos necessários sobre a empresa/setor/serviço/produto e as habilidades técnicas exigidas para fazer um atendimento rápido e eficaz.', 1, 'sim'),
(14, '14- ... consigo perceber as reclamações dos clientes como uma oportunidade de melhoria e de compreender melhor suas necessidades, entendendo como uma crítica construtiva.', 1, 'sim'),
(15, '1- ...que persiste quando está frente a um novo desafio, não desistindo nas primeiras dificuldades ...', 2, 'sim'),
(16, '2- ...que procura se colocar no lugar do outro, sendo compreensiva em relação aos momentos difíceis de outra pessoa...', 2, 'sim'),
(17, '3-...que consegue manifestar suas emoções de acordo com as pessoas, situações e o momento oportuno...', 2, 'sim'),
(18, '4-...que consegue controlar suas emoções, mantendo a calma nos momentos difíceis...', 2, 'sim'),
(19, '5-... que tem uma visão realista de si mesmo, com adequada percepção de suas potencialidades e limitações...', 2, 'sim'),
(20, '6- ...que consegue superar seus sentimentos de frustração quando alguma coisa não dá certo, procurando aprender com as experiências negativas...', 2, 'sim'),
(21, '7- ...que quando tem alguma dificuldade com outra pessoa, procura conversar diretamente com ela, evitando fofocas e mal entendido ...', 2, 'sim'),
(22, '8- ... que é muito difícil perder a paciência com as pessoas de que gosto. Se perco, logo recupero e me arrependo de ter perdido ...', 2, 'sim'),
(23, '9- ... que consegue expressar suas opiniões de forma clara e percebe que é ouvida com atenção ...', 2, 'sim'),
(24, '10-... que se sente segura diante das outras pessoas...', 2, 'sim'),
