INSERT INTO `db_resultado_pontos` (`id`, `teste_id`, `ponto`, `ponto_max`, `titulo`, `texto`) VALUES
(1, 1, 0, 30, 'Sua HABILIDADE PARA ATENDER CLIENTES é fraca.', 'Parabéns pela sua sinceridade nas respostas! Este resultado demonstra que, provavelmente, você gosta do seu trabalho, mas não foi devidamente preparado para assumi-lo, ou sua atividade profissional, não corresponde ao seu perfil e interesse pessoais. Procure, a partir deste teste, da observação das situações do dia-a-dia, e, principalmente, do feedback das pessoas, reconhecer suas vulnerabilidades e elaborar um plano de ações visando à melhoria de sua atuação. Procure aprender com todas as experiências, mesmo que sejam negativas, evitando repetir situações que promovam frustrações e comprometam a sua imagem. Se você deseja continuar trabalhando com atendimento, ou ainda não pode mudar de atividade, esforce-se para desenvolver, pelo menos, aquelas competências que sejam mais críticas para a satisfação do cliente e que impactarão o seu sucesso nessa atividade profissional. Busque ajuda e não desista, pois só você é capaz de vencer este desafio! Na classificação acima damos algumas sugestões para o desenvolvimento pessoal, que poderão ser extremamente úteis para você também! O mais importante é que você tenha a certeza de que sempre é possível desenvolver as competências, que envolvem a excelência no atendimento ao cliente, sejam elas tanto técnicas como emocionais.'),
(2, 1, 31, 41, 'Sua HABILIDADE PARA ATENDER CLIENTES É RAZOÁVEL', 'Você precisa, porém, desenvolver mais algumas competências Em alguns aspectos, suas atitudes em relação aos clientes ainda não são totalmente satisfatórias. O primeiro passo é identificar os pontos de melhoria, através da auto-análise, do feedback das pessoas que trabalham com você e também dos próprios clientes, buscando desenvolver as suas habilidades, através das ações adequadas às suas necessidades, tais como: treinamentos, coaching, mentoring, auto-ajuda, psicoterapia, aconselhamento e leituras relacionadas ao tema.'),
(3, 1, 42, 56, 'Sua HABILIDADE PARA ATENDER CLIENTES É BEM DESENVOLVIDA', 'Você deve ter facilidade para desempenhar suas funções e para se relacionar com os outros, de forma bem adequada e produtiva. Provavelmente, deve ser reconhecido como alguém extremamente profissional e que gosta do que faz! De qualquer forma, seja humilde para admitir eventuais falhas e dificuldades, buscando a sua própria superação e sendo melhor a cada dia!'),
(4, 2, 0, 10, 'Sua INTELIGÊNCIA EMOCIONAL é bastante baixa.', 'Procure compartilhar mais seus sentimentos e ideias. Acredite que melhorar seus relacionamentos não é difícil, mas exige trabalho persistente, e muita disponibilidade para o outro. Procure aprender com todas as experiências , mesmo que sejam negativas, evitando repetir situações que promovam frustrações.'),
(5, 2, 11, 20, 'Seu grau de empatia e relacionamentos não é bom.', 'Procure ouvir mais e falar menos. Saiba gostar até mesmo de particularidades que outras pessoas apresentam e que você critica.'),
(6, 2, 21, 30, 'Sua INTELIGÊNCIA EMOCIONAL precisa \"deslanchar\"', 'Converse um pouco mais consigo mesmo, ouça o que os outros dizem com sinceridade de você. Treine seus sentimentos de empatia e aprenda a observar com mais respeito os defeitos de outras pessoas.'),
(7, 2, 31, 40, 'Sua INTELIGÊNCIA EMOCIONAL é bastante desenvolvida', 'Mas se você aprender a observar atentamente as pessoas poderá desenvolvê-la ainda mais.'),
(8, 2, 41, 50, 'Sua INTELIGÊNCIA EMOCIONAL é bastante alta.', 'Você não deve ter dificuldades para fazer amigos, e nem de relacionar-se com os outros de forma bem harmoniosa e produtiva.');
