('term_policy', '<p style=\"text-align: center; \"><b>TERMO DE ACEITE PARA TRATAMENTO DE DADOS PESSOAIS\r\n</b></p><p><b>Exemplo:</b></p><p>Este documento visa registrar a manifestação livre, informada e inequívoca pela qual o usuário concorda com o tratamento\r\nde seus dados pessoais para finalidade específica, em conformidade com a Lei nº 13.709 – Lei Geral de Proteção de\r\nDados Pessoais (LGPD).\r\nAo aceitar o presente termo, o usuário consente e concorda que a empresa FACISC – Federação das Associações\r\nEmpresariais de Santa Catarina, CNPJ nº 78.354.636/0001-29, com sede na Rua Visconde de Cairú, 391 – Bairro Estreito\r\n– Florianópolis/SC, telefone (48) 3952.8844, e-mail facisc@facisc.org.br, doravante denominada Controlador, tome\r\ndecisões referentes ao tratamento de seus dados pessoais, bem como realize o tratamento de seus dados pessoais,\r\nenvolvendo operações como as que se referem a coleta, produção, recepção, classificação, utilização, acesso,\r\nreprodução, transmissão, distribuição, processamento, arquivamento, armazenamento, eliminação, avaliação ou controle\r\nda informação, modificação, comunicação, transferência, difusão ou extração.&nbsp;<br></p>');
